import './AdminConsole.css';
import { useState } from 'react';

function AdminConsole() {
  const [darkMode, setDarkMode] = useState(true);
  const [maintenance, setMaintenance] = useState(false);

  return (
    <div className="admin-wrapper">
      <aside className="admin-sidebar">
        <h2>‚öôÔ∏è Admin</h2>
        <ul>
          <li>üìä Dashboard</li>
          <li>üë• Users</li>
          <li>üìà Stats</li>
          <li>üß© Settings</li>
        </ul>
      </aside>

      <main className="admin-main">
        <h1>Admin Dashboard</h1>

        <div className="admin-cards">
          <div className="card">üë§ Users: 128</div>
          <div className="card">üí¨ Messages: 450</div>
          <div className="card">üåê Traffic: 1.2K/day</div>
        </div>

        <div className="admin-toggles">
          <div>
            <label>üåô Dark Mode</label>
            <input type="checkbox" checked={darkMode} onChange={() => setDarkMode(!darkMode)} />
          </div>
          <div>
            <label>üîß Maintenance</label>
            <input type="checkbox" checked={maintenance} onChange={() => setMaintenance(!maintenance)} />
          </div>
        </div>

        {/* üîú Charts & Table coming in next step */}
      </main>
    </div>
  );
}

export default AdminConsole;
